import Expenseitem from "./components/Expenseitem";

function App() {
 const Expdetails =[
   {thatDay: new Date('05 October 2021 14:48 UTC'),title:'Electricity',rate:397 },
   {thatDay: new Date('06 October 2012 14:48 UTC'),title:'Wifi',rate:500 },
   {thatDay: new Date('07 October 2021 14:48 UTC'),title:'Vegitables',rate:200 },
   {thatDay: new Date('08 October 2021 14:48 UTC'),title:'Mobile Prepaid',rate:200 },
   {thatDay: new Date('2 November 2021 14:48 UTC'),title:'others',rate:2000 },

]
  return (
    <div>
      <h2>Let's get started!</h2>
      <Expenseitem thatDay={Expdetails[0].thatDay} title={Expdetails[0].title} rate={Expdetails[0].rate} />
      <Expenseitem thatDay={Expdetails[1].thatDay} title={Expdetails[0].title} rate={Expdetails[0].rate}/>
      <Expenseitem thatDay={Expdetails[2].thatDay} title={Expdetails[0].title} rate={Expdetails[0].rate}/>
      <Expenseitem thatDay={Expdetails[0].thatDay} title={Expdetails[0].title} rate={Expdetails[0].rate}/>
      <Expenseitem thatDay={Expdetails[0].thatDay} title={Expdetails[0].title} rate={Expdetails[0].rate}/>

    </div>
  );
}

export default App;
